import React from 'react';

const AccountTitle = () => {
    return (
        <div className='account_title'>
            <span>DATE</span>
            <span>DESCRIPTION</span>
            <span>AMOUNT</span>
            <span>BALANCE</span>

        </div>
    );
}; 

export default AccountTitle;
